import React, { useState } from 'react';
import { TextField, Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import axios from 'axios';
// import { Link } from 'react-router-dom';

const Instances = () => {
  const [searchText, setSearchText] = useState('');
  const [projectData, setProjectData] = useState([]);
  const [error, setError] = useState(null);
  const [logs, setLogs] = useState('');
  const [loading, setLoading] = useState(false);



  // const fetchData = async () => {
  //   setLoading(true);
  //   try {
  //     const response = await axios.get(`http://localhost:8000/api/sshData?find=${searchText}`);
  //     setProjectData(response.data);
  //     setError(null);
  //   } catch (error) {
  //     console.error('Error fetching data:', error);
  //     setError('Error fetching data. Please try again.');
  //   }
  //   setLoading(false);
  // };
  const fetchData = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`http://localhost:8000/api/sshData?find=${searchText}`);
      setProjectData(response.data);
      console.log(response.data)
      setError(null);
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Error fetching data. Please try again.');
    }
    setLoading(false);
  };

  const handleSearch = () => {
    fetchData();
  };

  const handleReset = () => {
    setSearchText('');
    fetchData();
  };

  const handleClick = async (index) => {
    const data = projectData[index];
    try {
      const response = await axios.post('http://localhost:8000/api/validatessh', {
        awsAccessKey: data.awsAccessKey,
        awsSecretKey: data.awsSecretKey,
        sshUser: data.sshUser,
        region: data.region,
        sshIpAddress: data.sshIpAddress,
        sshKeyFilePath: data.sshKeyFilePath
      });
      setLogs(response.data);
    } catch (error) {
      console.error('Error validating SSH:', error);
      setError('Error validating SSH. Please try again.');
    }
  };

  
  return (
    <div>
      <TextField
        label="Search by Project Name"
        value={searchText}
        onChange={(e) => setSearchText(e.target.value)}
      />
      <Button variant="contained" onClick={handleSearch} disabled={loading}>
        Search
      </Button>
      <Button variant="contained" onClick={handleReset} disabled={loading}>
        Reset
      </Button>

      {loading && <p>Loading...</p>}
      {error && <p>{error}</p>}


          {projectData === "No documents found"? <h1>Data not found</h1>:<div>
          <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>Project Name</TableCell>
              <TableCell>SSH User</TableCell>
              <TableCell>Region</TableCell>
              <TableCell>SSH Port</TableCell>
              <TableCell>SSH IP Address</TableCell>
              <TableCell>SSH Key File Path</TableCell>
              <TableCell>Action</TableCell>
              <TableCell>Output</TableCell>
            </TableRow>
          </TableHead>

            <TableBody>
            {projectData.map((project,idx) => (
              <TableRow key={project._id}>
                <TableCell>{project._id}</TableCell>
                <TableCell>{project.projectName}</TableCell>
                <TableCell>{project.sshUser}</TableCell>
                <TableCell>{project.region}</TableCell>
                <TableCell>{project.sshPort}</TableCell>
                <TableCell>{project.sshIpAddress}</TableCell>
                <TableCell>{project.sshKeyFilePath}</TableCell>
                <TableCell>

                  <Button variant="contained" id={idx} onClick={(e)=>handleClick(e)}>Validate SSH</Button>
                </TableCell>
                <TableCell>{logs}</TableCell> {/* Display logs here */}

              </TableRow>
            ))}
          </TableBody>
          </Table>
      </TableContainer>
      </div>}
         
          
       
    </div>
  );
};

export default Instances;
